// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract OracleTest {
    address private oracleAddress;
    address private contractOwner;
    event ComputationRequest(uint256 requestId, string modelAddress, string testDataAddress);
    event ComputationProvided(uint256 requestId, string newModelAddress);

    mapping(uint256 => string) public requestNewModelAddress;
    uint256 public nextRequestId = 1;

    constructor (address _oracleAddress, address _contractOwner) {
        oracleAddress = _oracleAddress;
        contractOwner = _contractOwner;
    }

    modifier onlyOracle() {
        require(msg.sender == oracleAddress, "Only the oracle can call this function.");
        _;
    }

    // Function to request computation from the oracle
    function requestDataFromOracle(string memory modelAddress, string memory testDataAddress) public {
        uint256 requestId = nextRequestId;
        emit ComputationRequest(requestId, modelAddress, testDataAddress);
        nextRequestId++;
    }

    // Function for the oracle to provide data
    function provideData(uint256 requestId, string memory newModelAddress) public onlyOracle {
        requestNewModelAddress[requestId] = newModelAddress;
        emit ComputationProvided(requestId, newModelAddress);
    }

    // Function to update the oracle address
    function setOracleAddress(address _newOracleAddress) public {
        // Restrict this function to the contract owner
        require(msg.sender == contractOwner, "Only the contract owner can call this function.");
        oracleAddress = _newOracleAddress;
    }

    // Function to transfer ownership of the contract
    function transferOwnership(address newOwner) public {
        require(msg.sender == contractOwner, "Only the contract owner can call this function.");
        contractOwner = newOwner;
    }

}
